import sys
from gmpy import comb

MAX_N = 510
MOD = 100003

d = []
for i in range(MAX_N):
    d.append( [-1] * MAX_N)

def f(n, k):
    if n < 0 or k < 0: 
        return 0
    if n <= k: 
        return 0
    if n == k + 1: 
        return 1
#    print "%d %d" % (n, k)

    if d[n][k] != -1:
        return d[n][k]

    res = 0
    
    t = n - k - 1
    for i in range(t+1):
        res += f(k, k-i-1) * comb(t, i)
        res %= MOD

    d[n][k] = res
    return res

